// src/components/BookingDetails.js
import React from 'react';

const BookingDetails = ({ selectedSpot, spots }) => {
  const spot = spots.find((spot) => spot.id === selectedSpot);

  return (
    <div className="booking-details-container">
      <h3>Rincian Pemesanan</h3>
      {selectedSpot ? (
        <div>
          <p>Tempat parkir yang dipilih: P{selectedSpot}</p>
          <p>Status: {spot?.status === 'occupied' ? 'Terisi' : 'Tersedia'}</p>
        </div>
      ) : (
        <p>Silakan pilih tempat parkir terlebih dahulu.</p>
      )}
    </div>
  );
};

export default BookingDetails;
